import React from 'react';
import Item from './Item'

function List(props) {
    return (
        <ul className="todo-main">
            {
                props.todos.map((todo, index) => (
                    <Item
                        key={index}
                        todo={todo}
                    />
                ))
            }
        </ul>
    )
}

export default List
